// utils.js (client)
import "isomorphic-fetch"

export function addName(name) {

    return fetch('http://localhost:3001/addtime', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ name, time: Date.now() }) // the reason you're getting wacky number is because its counting time down from 1970
    })
}
